import React from 'react';
import './nps.mp4';
import { Button } from 'react-bootstrap';
import Navigationbar from '../Navbar/NavigationBar';
import About from '../About';

function Home() {
  const aboutButtonPressed = () => {
    <div>
      <About></About>
      <Navigationbar></Navigationbar>
    </div>;
  };

  return (
    <div>
      <h1>Welcome to the National Park Service Online Tour Guide!</h1>
      <button class="btn-primary pull-left" onClick={aboutButtonPressed}>
        About
      </button>
      <button class="btn-danger pull-right">Mirror</button>
    </div>
  );
}

export default Home;
